import React from "react";
import styled from "styled-components";
import LatestProducts from "../lastest-products/latest-products.component";

export const FeaturedProductOverViewContainer = styled.div`
  width : 85%;
  height : 600px;
  margin : auto;
  display : flex ; 
  background-color : lightblue;
`

export const LatestProductsComponent = styled(LatestProducts)`
  flex : 1 0 30%;
  background-color : red;
`
